【セカンドバッグ メンズ men's バッグ セカンド クロコ型押し　クロコ 出張 人気】<br>

<br>
牛革にクロコ型押しした、品格漂う質感とフォルム。<br>
素材、設計に拘り作られた、ワンランク上の上質を演出するメンズセカンドバッグです。<br>
<br>
スクエアタイプの重量感のあるフォルムで、<br>
ダブルファスナーを開くとそれぞれ独立した収納ポケットが現れるデザイン。<br>
<br>
財布や手帳、携帯電話もしっかりと収まるサイズ。<br>
スッキリとしたフォルムは抱えたり下げたりとシーンに合わせての使い分けができます。<br>
<br>
前面にはファスナー式ポケット、後面にはマグネットポケットを装備しており、<br>
使用頻度の高いカードケースや定期入れ等の小物類を収納しておくと大変便利です。<br>
<br>
「セカンドバッグ　メンズ 牛革 クロコ型押し」を是非おためし下さい。<br>

<br>
◆素材◆<br>
牛革：合皮
<br><br> 
◆本体サイズ◆<br>
約　H26cm×W14cm×D10cm<br>
<br>

◆仕様◆<br>
ダブルファスナー式収納使用<br>
  収納A ： 大ポケット×1、ファスナー式ポケット×1<br>
  収納B ： 大ポケット×1、携帯ポケット×1、多用途ポケット×1<br>
  前面  ： ファスナー式ポケット×1<br>
  背面  ： マグネット式ポケット×1<br><br>
※現物に近い色が出る様に写真を撮っておりますが、多少濃く見えたり、薄く見えたりする場合がございます。<br>
新品未使用品ですが、商品の性質や構造上により、どうしても小さい傷などが生じる場合が御座います。
